    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col2 IN ( - - col0 * - - col2 + 26, col1 * + col0, + col1 * - - 1 );
  - name: tab2

outputs:
  - name: q8825.out
    data: |
      46	51	23
      64	77	40
      75	67	58
